import "./App.css";
import * as React from "react";
import Avatar from "@mui/material/Avatar";
import Stack from "@mui/material/Stack";
import { deepOrange } from "@mui/material/colors";
import List from "@mui/material/List";
import ListItem from "@mui/material/ListItem";
import ListItemText from "@mui/material/ListItemText";
import Divider from "@mui/material/Divider";

function App() {
  return (
    <div className="App">
      <ImageAvatars />
      <InformacaoPessoal />
    </div>
  );
}

function ImageAvatars() {
  return (
    <div className="Avatar">
      <Stack direction="row" spacing={2}>
        <Avatar
          alt="Remy Sharp"
          src="/static/images/avatar/1.jpg"
          sx={{ bgcolor: deepOrange[500], width: 70, height: 70 }}
        />
      </Stack>
    </div>
  );
}

function InformacaoPessoal() {
  return (
    <div className="InformacaoPessoal">
      <List
        sx={{
          width: "100%",
          maxWidth: 500,
          bgcolor: "background.paper",
        }}
      >
        <Divider variant="inset">Informações Pessoais</Divider>
        <ListItem>
          <ListItemText primary="Nome" secondary="Ayron Brhenno Silva Figueiredo" />
        </ListItem>
        <Divider variant="inset" component="li" />
        <ListItem>
          <ListItemText primary="Email" secondary="ayronbrhennoo@gmail.com" />
        </ListItem>
        <Divider variant="inset" component="li" />
        <ListItem>
          <ListItemText primary="Telefone" secondary="66 99967-5618" />
        </ListItem>
      </List>
    </div>
  );
}

export default App;
